function() {
  var el = {{Click Element}} || document.querySelector('[data-section]');
  if (!el) return 'unknown';

  // Mapeo específico para las secciones reales de Lourdes
  var id = el.id || el.getAttribute('data-section');
  var sectionMap = {
    'hero': 'Hero Principal',
    'servicios': 'Nuestros Servicios', 
    'sectores': 'Sectores Atendidos',
    'benefits': 'Beneficios',
    'testimonials': 'Testimonios',
    'contacto': 'Formulario de Contacto',
    'about-us': 'Sobre Nosotros',
    'cta': 'Llamada a la Acción'
  };

  if (id && sectionMap[id]) return sectionMap[id];

  // Buscar por clases específicas de Lourdes
  var className = el.className && el.className.toString();
  if (className) {
    if (className.includes('hero')) return 'Hero Principal';
    if (className.includes('service')) return 'Servicios';
    if (className.includes('sector')) return 'Sectores';
    if (className.includes('benefit')) return 'Beneficios';
    if (className.includes('testimonial')) return 'Testimonios';
    if (className.includes('contact')) return 'Contacto';
  }

  return 'Section';
}
